type events = {
    id: number;
    text: string;
    date: string;
};

const Events = ({ props: events }) => {

    const { id, text, date } = props;
    return (
        <>
            {events.map((event) => (
                <h3 key={event.id}>{event.text}</h3>
            ))}
        </>
    )
}

export default Events
